        internal void Uncompress(string Hexa)
        {
            Reader br = new Reader(Hexa.HexaToBytes());

            Console.WriteLine($"War State {(WarState)br.ReadInt32()}");
            Console.WriteLine($"Preparion End Time {DateTime.Now.AddSeconds(br.ReadInt32()).ToString()}");

            Console.WriteLine($"Alliance ID {br.ReadInt64()}");
            Console.WriteLine($"Alliance Name {br.ReadString()}");
            Console.WriteLine($"Alliance Badge {br.ReadInt32()}");
            Console.WriteLine($"Alliance Level {br.ReadInt32()}");

            Console.WriteLine($"Unkown int {br.ReadInt32()}");
            Console.WriteLine($"War Participant {br.ReadInt32()}");

            Console.WriteLine($"Player 1 Alliance ID {br.ReadInt64()}");
            Console.WriteLine($"Player 1 User ID {br.ReadInt64()}");
            Console.WriteLine($"Player 1 Home ID {br.ReadInt64()}");
            Console.WriteLine($"Player 1 Name {br.ReadString()}");

            Console.WriteLine($"Player 1 Star Given {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Damage {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Unkown int {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Attack Used {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Total Defense {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Gold Gain {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Elixir Gain {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Dark Elixir Gain {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Gold Available {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Elixir Available {br.ReadInt32()}");
            Console.WriteLine($"Player 1 DarkElixir Available {br.ReadInt32()}");
            Console.WriteLine($"Player 1 OffenseWeight  {br.ReadInt32()}");
            Console.WriteLine($"Player 1 DefenseWeight {br.ReadInt32()}");

            Console.WriteLine($"Player 1 Unkown int {br.ReadInt32()}");
            Console.WriteLine($"Player 1 Town Hall {br.ReadInt32()}");
            var data = br.ReadFully();
            Console.WriteLine(BitConverter.ToString(data).Replace("-", ""));
            Console.WriteLine(Encoding.UTF8.GetString(data));
        
        }

        internal void GoogleTest()
        {
            using (var Stream = new FileStream("client_secret.json", FileMode.Open, FileAccess.Read))
            {
                this.OCredentials = GoogleWebAuthorizationBroker.AuthorizeAsync(GoogleClientSecrets.Load(Stream).Secrets, new[]
                {
                    GamesService.Scope.Games, GamesService.Scope.PlusLogin
                }, "com.barbarianland.galileo", CancellationToken.None, new FileDataStore("Galileo.Server")).Result;
            }

            this.OClient = new GamesService(new BaseClientService.Initializer
            {
